window.bookSummaryJSON = "<p><i>The Three Musketeers</i> meets Jules Verne in Curtis Craddock's <i>The Last Uncharted Sky</i>, the concluding novel in the critically acclaimed high-fantasy Risen Kingdoms series, an engrossing tale of courtly intrigue and breathtaking magic.</p> <p>Isabelle and Jean-Claude undertake an airship expedition to recover a fabled treasure and claim a hitherto undiscovered craton for l'Empire Celeste. But Isabelle, as a result from a previous attack that tried to subsume her body and soul, suffers from increasingly disturbing and disruptive hallucinations. Disasters are compounded when the ship is sabotaged by an enemy agent, and Jean-Claude is separated from the expedition.</p> <p>In a race against time, Isabelle must figure out how to ward off her ailment before it destroys her and reunite with Jean-Claude to seek the fabled treasure as ancient secrets and a royal conspiracy threaten to undo the entire realm.</p>"; 
